    queries: { total: 0, successful: 0, failed: 0, pending: 0 },
    records: { stored: 0, provided: 0, received: 0 },
    buckets: { total: 0, full: 0, depth: 0 },
    network: { closestPeers: [], knownPeers: 0 },
    status,
    lastActivity: null,
